//액션 타입 정의

const ADD_ENDDATE = "DateRangePicker/ADD_ENDDATE";

//액션 생성 함수 정의

export const addEndDate = end => {
  return {
    type: ADD_ENDDATE,
    payload: end
  };
};

// 초기값 설정
const INITIAL_STATE = "";

// 리듀서

export default function endReducer(state = INITIAL_STATE, action) {
  switch (action.type) {
    case ADD_ENDDATE:
      return action.payload;
    default:
      return state;
  }
}
